sr-only:
position: absolute;width: 1px;
height: 1px;
padding: 0;
margin: -1px;
overflow: hidden;
clip: rect(0, 0, 0, 0);
white-space: nowrap;
border-width: 0;

not-sr-only:
position: static;width: auto;
height: auto;
padding: 0;
margin: 0;
overflow: visible;
clip: auto;
white-space: normal;

animate-spin:
animation: spin 1s linear infinite;
@keyframes spin {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}

animate-ping:
animation: ping 1s cubic-bezier(0, 0, 0.2, 1) infinite;
@keyframes ping {
  75%, 100% {
    transform: scale(2);
    opacity: 0;
  }
}

animate-pulse:
animation: pulse 2s cubic-bezier(0.4, 0, 0.6, 1) infinite;
@keyframes pulse {
  0%, 100% {
    opacity: 1;
  }
  50% {
    opacity: .5;
  }
}

animate-bounce:
animation: bounce 1s infinite;
@keyframes bounce {
  0%, 100% {
    transform: translateY(-25%);
    animation-timing-function: cubic-bezier(0.8, 0, 1, 1);
  }
  50% {
    transform: translateY(0);
    animation-timing-function: cubic-bezier(0, 0, 0.2, 1);
  }
}

inset-auto:
top: auto;right: auto;
bottom: auto;
left: auto;
